import Container from "../Container/Container";
import "./Navbar.css";

function Navbar() {
    return (
      <div>
        <Container>
          <div className="navbar">
            <span >Google Books Search Utility</span>
          </div>
        </Container>
      </div>

    )
}

export default Navbar;
